import React, { Component } from 'react'

class Pagination extends Component {
    render() {
        return (
            <div className="pagination">
            <ul style={{color:'#fff'}}>
                <li><a onClick={paginationClick(1)}>1</a></li>
                <li><a>2</a></li>
                <li><a>3</a></li>
                <li><a>4</a></li>
            </ul>
        </div>
        )
    }
}
export default Pagination
